import { useState,useEffect } from "react";
import { useZohoContext } from "../Context/ZohoContext";

const EditarContactoBrand = () => {
    
    const {contactos} = useZohoContext();
    const [mostrarContactos, setMostrarContactos]=useState(false);
    useEffect(() => {
        setMostrarContactos(true)
    }, [contactos])

    return ( 
        <div>
            {mostrarContactos?
                <div>
                    {contactos.map(contacto =>(
                        <div key={contacto.Full_Name}>{contacto.Full_Name}</div>
                    ))}
                </div>:""}
        </div>
     );
}
 
export default EditarContactoBrand;
